import React from 'react'
import im from "./luffy.jpg"

export default function LandingPage() {
  return (
    <div>
        <div className='top'>
            <h4 style={{display:"inline"}}>MATALAN</h4>
            <img src={im} alt='Logo' style={{width:"50px", height:"50px" , borderRadius:"50px"}} />
        </div>
      
    </div>
  )
}
